import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Note = (props) => {

    const deleteItem = () => {
        props.deleteItem(props);
    }

 return(
   <>
        <p> {props.titel} </p>
        <br/>
        <p> {props.contant} </p>
        <Button onClick={deleteItem}><DeleteIcon/></Button>
   </>
 );

}

export default Note;
